sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if(inputs.status == "200" || inputs.status == "201"){
    try{
      var responseData = JSON.parse(inputs.response);
      outputs.availabilityDomain = responseData.availabilityDomain;
      outputs.cidrBlock = responseData.cidrBlock;
      outputs.compartmentId = responseData.compartmentId;
      outputs.dhcpOptionsId = responseData.dhcpOptionsId;
      outputs.displayName = responseData.displayName;
      outputs.id = responseData.id;
      outputs.lifecycleState = responseData.lifecycleState;
      outputs.routeTableId = responseData.routeTableId;
      outputs.securityListIds = responseData.securityListIds;
      outputs.timeCreated = responseData.timeCreated;
      outputs.vcnId = responseData.vcnId;
      outputs.virtualRouterIp = responseData.virtualRouterIp;
      outputs.virtualRouterMac = responseData.virtualRouterMac;
      outputs.subnetDomainName = responseData.subnetDomainName;
      outputs.ipv6PublicCidrBlock = responseData.ipv6PublicCidrBlock;
      outputs.ipv6VirtualRouterIp = responseData.ipv6VirtualRouterIp;
      outputs.ipv6CidrBlock = responseData.ipv6CidrBlock;
      outputs.prohibitPublicIpOnVnic = responseData.prohibitPublicIpOnVnic;
      outputs.definedTags = responseData.definedTags;
      outputs.dnsLabel = responseData.dnsLabel;
      outputs.freeformTags = responseData.freeformTags;
      outputs.status = "success";
    }
  catch(ex){
	throw new Error('JSON Parse Error. Response Body may be empty.');
  }
}
 else {
       var errorData = new OracleVCN_ErrorHandling().errorHandler(inputs.response);
   		outputs.errormessage = errorData[0];
        outputs.status = errorData[1];
    }
})(inputs, outputs);

